Wed August 18, 2010
Athenna called me up and asked if she can sunbathe in our backyard since she lived in an apartment complex and could never really get any privacy by the community pool. She loves the way the sun feels as it gently bakes her ginormous gazongas. I, of course, said yes and she came over and did her thing. I was about to head out with Voodoo to get some drinks at one of our favorite bars when we caught a glimpse of her tanning by the pool. We were basically horny, peeping toms for quite some time until I told Voodoo I would go out there and see if she needed some company. After seeing her practically play with herself, I knew she would be more than willing to have some fun with Voodoo. She was so impressed with his size that she immediately wanted to move the festivities indoors and really take a load off on her day off. Voodoo gave her a huge load all over her astronomically astounding avocados. They are big. They are natural. They are all for your enjoyment.

